exports.getCategories = function () {
  const categories = [];
  this.jobCategories.forEach(jobCat => categories.push(jobCat.practice_seo_name));

  return categories;
};

exports.getSubCategories = function () {
  const subcategories = [];
  this.jobCategories.forEach(jobCat => {
    if (jobCat.subcategories.length > 0) {
      jobCat.subcategories.forEach(subCat => subcategories.push(subCat.practice_seo_name));
    }
  });

  return subcategories;
};

exports.getAllCategories = function () {
  const categories = this.getCategories();
  const subcategories = this.getSubCategories();

  return categories.concat(subcategories);
};
